import ReactDOM from 'react-dom';
import './index.css';
import * as serviceWorker from './serviceWorker';
import Layout from './components/Layout'
import { Navbar } from 'react-bootstrap';

ReactDOM.render(
  <React.StrictMode>
  <Navbar/>
  <L/>
  </React.StrictMode>,
  document.getElementById('root')
);

